        public  VaktijaVM VaktijaZaDan(DateTime dan)
        {
            var januar1 = new DateTime(DateTime.Now.Year, 1, 1);
            int brojDana = (int)(dan - januar1).TotalDays;
            int godina = dan.Year;
            if (dan.Date > new DateTime(godina, 2, 28) && !DateTime.IsLeapYear(godina)) {
                brojDana++;
            }

            var vaktijaVM = new VaktijaVM();
            string grad = LokacijaVM.Grad;

            string mjesec = dan.Month.ToString().PadLeft(2, '0');
            var korekcija = korekcijaVremena [mjesec + ';' + grad].Split(' ');
            int korekcijaZaZoru = Convert.ToInt32(korekcija[0]);
            int korekcijaZaPodne = Convert.ToInt32(korekcija[1]);
            int korekcijaZaIkindiju = Convert.ToInt32(korekcija[2]);

            vaktijaVM.IzlazakSunca = korigujVrijeme(dan, izlazakSunca[brojDana], korekcijaZaZoru);
            vaktijaVM.Zora = korigujVrijeme(dan, zora[brojDana], korekcijaZaZoru);
            vaktijaVM.Podne = korigujVrijeme(dan, podne[brojDana], korekcijaZaPodne);
            vaktijaVM.Ikindija = korigujVrijeme(dan, ikindija[brojDana], korekcijaZaIkindiju);
            vaktijaVM.Aksam = korigujVrijeme(dan, aksam[brojDana], korekcijaZaIkindiju);
            vaktijaVM.Jacija = korigujVrijeme(dan, jacija[brojDana], korekcijaZaIkindiju);
            vaktijaVM.Datum = dan.ToString("dd.MM.yyyy");
            

            return vaktijaVM;
        }

        private  string korigujVrijeme(DateTime dan, string vrijeme, int korekcija)
        {
            bool daylightSaving = TimeZoneInfo.Local.IsDaylightSavingTime(dan);

            int sati = Convert.ToInt32(vrijeme.Substring(0, 2));
            if (daylightSaving) sati++;

            int minute = Convert.ToInt32(vrijeme.Substring(3)) + korekcija;
                
            return sati.ToString().PadLeft(2, '0') + ':' + minute.ToString().PadLeft(2, '0');
        }


